window.bookSummaryJSON = "<p><b><i>Killian</i></b><br> <br> Soon, I’ll have to marry the most powerful queen and rule two kingdoms.<br> <br> But all I want is Barbie, the new girl in my house and the only thing I can’t have.<br> <br> If I take her for my own, she’ll be murdered. <br> <br> I know I should stay away from her, but I no longer can, even if the kingdoms collapse and the world burns as a consequence.<br> <br> I might be the villain in the story, but without her, there’s no meaning to my brutal, miserable existence.<br> <br> So, I start to push her to the breaking point so she can survive the bride trials and rise above it all.<br> <br> Only I don’t expect it to hurt so much to see my rivals, the other heirs, swoop in to try to make her theirs.</p>"; 
